(1, '2', 14, '18', NULL, '1', 'Reading Assignment 1', '2020-08-10', '2020-08-13', '10', '&lt;p&gt;Read Chapters 1 and 2 and write a synopsis of the text. We will also have a quiz on Friday, Aug 14th.&lt;/p&gt;\r\n', 1, '2020-08-11 17:54:01', NULL),
